		/*!40000 ALTER TABLE `Mobs` ENABLE KEYS */;
		
		-- ----------------------------
		-- Reduce mob vita to speed up gameplay
		-- ----------------------------
		UPDATE
			`Mobs`
		SET
			`MobVita` = MobVita * 0.2,
			`MobExperience` = MobExperience * 0.3
		WHERE
			`MobExperience` > 999
		AND
			`MobIsBoss` = 0
		AND
			`MobIdentifier` NOT IN (
				'witch_shaman',
				'skeleton_ju',
				'trapdoor spider',
				'massive_scorpion',
				'fire_worm',
				'warthog',
				'giant_mantis',
				'blood_mantis',
				'wicked_ghost',
				'blood_tick',
				'sute',
				'ice_panther'
				'ogre_citelam',
				'ogre_maletic',
				'muck_ogre',
				'slime_ogre',
				'log_ogre',
				'hill_ogre',
				'evil_presence',
				'strange_thing',
				'man_shik_raven',
				'dirt_mantis',
				'shadow_mantis',
				'sting',
				'chtan',
				'sintu',
				'skeleton_sa',
				'zangze_ogre',
				'zinte_ogre',
				'death_wish',
				'golden_lobster',
				'crimson_scorpion',
				'horse_guardsman',
				'horse_swordsman',
				'hooves')
		AND
			(`MobVita` < 1750000 OR `MobIdentifier` LIKE '%_ogre')
		AND
			`MobIdentifier` NOT LIKE '%dummy%'
		AND
			`MobIdentifier` NOT LIKE '%_sentry'
		AND
			`MobIdentifier` NOT LIKE '%_guardian'
		AND
			`MobIdentifier` NOT LIKE '%_defender'
		AND
			`MobIdentifier` NOT LIKE '%_king'
		AND
			`MobIdentifier` NOT LIKE 'tiger_%'
		AND
			`MobIdentifier` NOT LIKE 'new_years_%'
		AND
			`MobIdentifier` NOT LIKE '%instance%'
		AND
			`MobIdentifier` NOT LIKE 'call_companion_%'
		AND
			`MobIdentifier` NOT LIKE 'cotw_%'
		AND
			`MobIdentifier` NOT LIKE 'abyssal_%';

		INSERT INTO `MigrationHistory` (Script,Timestamp) VALUES (scriptName,NOW());
	ELSE
		SELECT CONCAT(scriptName, ' was skipped because it is already present in the migration history.') AS '';
	END IF;
END $$

